{'pk': 17915237686371743, 'user_id': 3721545173, 'text': 'El próximo miércoles 11/12 tenemos el placer, el honor y la alegría de recibir a nuestro amigo @maxrompo y sus acuarelas en nuestra librería.
En esta serie, el artista gráfico pone en papel y al agua espacios y lugares que ha visitado y transitado durante el 2019, y los muestra por primera vez entre nuestros libros y bibliotecas.
@maxrompo ha acompañado a @cespedeslibros desde sus inicios. Nos llena de felicidad que nos haya dado esta oportunidad de retribución y seguir en compañía.
