{'pk': 18103631077077301, 'user_id': 3721545173, 'text': 'Madre noche de Kurt Vonnegut 
El escritor soldado #kurtvonnegut, testigo de la segunda gran guerra del siglo XX, nos trae la historia de un doble agente a punto de ser juzgado en Israel por crímenes de guerra. El absurdo de ser el mayor propagandista Nazi y agente norteamericano cobra vida en la piel de nuestro héroe que advierte desde la primera página que uno es quien finge ser, y por tanto hay que tener cuidado con quién pretendemos ser. 
Madre noche es también una fábula de la lucha de poderes en cuyo núcleo se esconde, además, una historia de amor tan bizarra como trágica y profunda.  Ícono contracultural y gran contador de historias, Vonnegut nos invita, una vez más, a leer en la cornisa que separa (o integra?) el bien y el mal.

