{'pk': 18079019188133008, 'user_id': 3721545173, 'text': 'Este año en la FED, @anaojota y @fanticecilia como parte de su ciclo Ojeda & Fanti invitaron a un debate entre Beatriz Sarlo, escritora e intelectual, y Santiago Kalinowski, lingüista y miembro de la Academia Argentina de Letras. El eje era el lenguaje inclusivo, un debate en torno a su uso, su resistencia, su fuerte sentido actual y político. Cada uno, desde posturas opuestas, conversaron por más de una hora con un auditorio lleno. En este libro, @edicionesgodot trae el debate tal como se dio hasta nuestras bibliotecas.
Un libro hecho en el presente y que mira el futuro, se anima a discutir y nos propone reflexionar junto a los disertantes sobre el uso y las mutaciones del lenguaje.

