{'pk': 18027949045234911, 'user_id': 3721545173, 'text': 'La tierra empezaba a arder es un relato de viaje, una memoria familiar y un testimonio de Siria antes del estallido de la guerra. 
La protagonista viaja con su madre a visitar a su familia pero también a resolver cuestiones pendientes de una herencia. Ese viaje configura, a su vez, un encuentro entre oriente y occidente, el cruce de dos cosmovisiones y de dos familias que se relacionan de manera opuesta con su origen.
En este libro, Cynthia Edul pinta su aldea para pintar el mundo. Es decir, cuenta su Siria familiar para armarnos el mapa geopolítico de ese país en la actualidad y cómo, la Siria que vieron sus ojos por última vez, dejó de existir para siempre.

@fanticecilia
