{'pk': 18100126174077827, 'user_id': 3721545173, 'text': 'Maus 
La madre de las novelas gráficas. En blanco y negro hipnótico, Art Spiegelman nos propone escondernos en las calles del gheto, en los agujeros negros de los campos de concentración, en la historia de sus antepasados. Bucear en las profundidades del recuerdo de un sobreviviente es una tarea difícil hasta para el propio autor, quien reconstruye el gran horror del siglo veinte recuperando los recuerdos de su padre. Un clásico para tod☀s, y que es también una puerta de entrada al mundo fascinante del cómic y la novela gráfica.

