{'pk': 17879513788437421, 'user_id': 3721545173, 'text': '“Apollo me mira, con el ceño fruncido. De ojo a ojo. ¿Qué piensan los perros cuando ven llorar a alguien? Criados para dar consuelo, nos econdortan. Pero qué desconcertante ha de ser la infelicidad humana para ellos. Nosotros, que podemos llenar nuestros platos en cualquier momento y con tanta comida como queramos, que podemos salir cuando nos apetezca y obrar con libertad –nosotros que no tenemos un amo que necesita que le satisfagan u obedezcan constantemente-… ¿Qué demonios?”
Tras el suicidio de su mejor amigo escritor, la protagonista de esta novela –también escritora- hereda a su perro. La historia del duelo por la pérdida se mezcla con la de esta en principio obligada y creciente compañía. “El amigo” no es un libro sobre la amistad entre el perro y el hombre (en este caso, la mujer) ni tampoco podríamos resumirlo en la frase trillada que reza que “el perro es el mejor amigo del hombre”.
Este libro es una conversación imaginaria que la protagonista tiene con su amigo ausente. Un recorrido por esa amistad plagada de secretos, pactos rotos y escena literaria neoyorkina. Pero “El amigo” es, sobre todo, un tratado sobre literatura y sobre cuánto de la vida se le puede prestar a la literatura para escribir un libro.
Un libro para escritores, amantes de la literatura, de la amistad, de los perros y de la vida.

