{'pk': 17854598923538227, 'user_id': 3721545173, 'text': '“Las vacaciones nunca son muy placenteras. Menos cuando uno no conoce tanto al otro. Es todo medirse, medir, levantar los vasos y no hacer la cama para que no parezca que queremos estar en orden, en equilibrio con algo. Pero la naturaleza es rabiosa y deja todo lo peor a la vista.” Los cuentos de Magalí Etchebarne buscan e indagan: las relaciones de pareja, la familia, el dolor, el engaño, los finales, los días que conforman vidas. 
Los temas que motorizan su literatura son tan vitales como sutiles. A los personajes, a su animalidad o domesticación se les enfrenta el golpe de gracia de la (su) naturaleza, siempre rabiosa y desatada. Como lectores, nos dejamos ganar por la ilusión literaria y cuando queremos acordar ya estamos frente a momento preciso y espeso del cuento en los que se abre la compuerta y el desborde nos hipnotiza hasta el final. Abrupto a veces, moroso otros. Nunca indiferente.
Los cuentos de Los mejores días, como gran parte de la literatura escrita por mujeres, cuentan a partir de los detalles menores y cotidianos que se cuecen en los pliegues invisibles de la experiencia. 
Magalí Etchebarne nos lleva de las narices por las vidas de estos personajes, hombres y mujeres, que andan a tientas tratando de encontrar el switch que ilumine la habitación y les señale una salida posible.

